    }

    string internal constant svgStart = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 550 760">';
    
    string internal constant svgButtons = ' <g stroke="#303133" stroke-width="5" fill="url(#Gradient2)" > <rect onclick="handleNumber(1)" rx="7" x="50" y="530" width="80" height="80"/> <rect onclick="handleNumber(2)" rx="7" x="150" y="530" width="80" height="80"/> <rect onclick="handleNumber(3)" rx="7" x="250" y="530" width="80" height="80"/> <rect onclick="handleNumber(4)" rx="7" x="50" y="430" width="80" height="80"/> <rect onclick="handleNumber(5)" rx="7" x="150" y="430" width="80" height="80"/> <rect onclick="handleNumber(6)" rx="7" x="250" y="430" width="80" height="80"/> <rect onclick="handleNumber(7)" rx="7" x="50" y="330" width="80" height="80"/> <rect onclick="handleNumber(8)" rx="7" x="150" y="330" width="80" height="80"/> <rect onclick="handleNumber(9)" rx="7" x="250" y="330" width="80" height="80"/> <rect onclick="handleNumber(0)" rx="7" x="50" y="630" width="80" height="80"/> <rect onclick="handleNumber(symbols.de)" rx="7" x="150" y="630" width="80" height="80"/> //. <rect onclick="handleOp(add, symbols.add)" rx="7" x="350" y="530" width="150" height="80"/> //+ <rect onclick="handleOp(sub, symbols.sub)" rx="7" x="350" y="430" width="150" height="80"/> //- <rect onclick="handleOp(mul, symbols.mul)" rx="7" x="350" y="330" width="150" height="80"/> //x <rect onclick="handleOp(div, symbols.div)" rx="7" x="350" y="230" width="150" height="80"/> // / <rect onclick="handleOp(mod, symbols.mod)" rx="7" x="150" y="230" width="80" height="80"/> <rect onclick="handleOp(pow, symbols.pow)" rx="7" x="250" y="230" width="80" height="80"/> <rect onclick="clearScreen()" fill="url(#Gradient3)" rx="7" x="50" y="230" width="80" height="80"/> <rect onclick="equals()" fill="url(#Gradient1)" rx="7" x="250" y="630" width="250" height="80"/> </g >';
    
